  true,\n\t\"url\": null,\n\t\"notes\": \"The National Household Education Survey,
  2003 Parent and Family Involvement in Education (PFI-NHES:2003), is a study that
  is part of the National Household Education Survey (NHES) program. PFI-NHES:2003
  (http://nces.ed.gov/nhes/) is a cross-sectional survey that collects data directly
  from households on educational issues. This study was conducted using an address
  based sample of self-administered questionnaires of households. Households in 2003
  were sampled. The studyufffds response rate was 64.7 percent. Key statistics produced
  from PFI-NHES:2003 are early childhood care and education, childrenufffds readiness
  for school, parent perceptions of school safety and discipline, before- and after-school
  activities of school-age children, and homeschooling..\",\n\t\"license_title\":
